    false,nt"url": null,nt"notes": "NODC Accession 0115714 includes chemical,
    meteorological, physical and underway - surface data collected from NOAA Ship Bell
    M. Shimada in the Coastal Waters of SE Alaska, Cordell Bank National Marine Sanctuary,
    Gulf of the Farallones National Marine Sanctuary, North Pacific Ocean and Olympic
    Coast National Marine Sanctuary from 2012-02-20 to 2012-09-16 and retrieved during
    cruise 332220120220, 332220120327, 332220120717 and 332220120905. These data include
    AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC
    PRESSURE, CARBON DIOXIDE - AIR, Partial pressure (or fugacity) of carbon dioxide,
    SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these data
    include Barometric pressure sensor, Carbon dioxide (CO2) gas analyzer, Shower head
    chamber equilibrator for autonomous carbon dioxide (CO2) measurement and thermosalinographs.
    These data were collected by Catherine E. Cosca, Richard A. Feely, Simone R. Alin
    and Geoffrey T. Lebon of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory
    as part of the VOS_Bell_Shimada_SH1201, VOS_Bell_Shimada_SH1202_L1, VOS_Bell_Shimada_SH1204_L2
    and VOS_Bell_Shimada_SH1206 data set.nnThe Global Volunteer Observing Ship (VOS)
    Program is coordinated by the UNESCO International Ocean Carbon Coordination Project
    (IOCCP). International groups from 14 countries have been outfitting research ships
    and commercial vessels with automated CO2 sampling equipment to analyze the carbon
    exchange between the ocean and atmosphere.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
